import React from 'react'
import {useState, useEffect} from 'react'
import axios from 'axios'

const CurrentWeather = () => {
    let [currentWind, setCurrentWind] = useState(null)
    useEffect(()=>{
    axios.get('https://api.open-meteo.com/v1/forecast?latitude=32.77&longitude=-96.791&current=wind_speed_10m').then((response) => {
        setCurrentWind(response.data)
        console.log(response)
        }
    )}
)
    return(
        <div>
            <h1>Current wind {currentWind? 0:0}</h1>
        </div>
    )
}
export default CurrentWeather;
